import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Sidebar from "./components/Sidebar";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import GeneralAptitude from "./pages/GeneralAptitude";
import VerbalReasoning from "./pages/VerbalReasoning";
import CurrentAffairs from "./pages/CurrentAffairs";
import Programming from "./pages/Programming";
import "./styles/App.css";

const App = () => {
  return (
    <Router>
      <div className="app-container">
        <Sidebar />
        <div className="main-content">
          <Navbar />
          <div className="content">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/general-aptitude" element={<GeneralAptitude />} />
              <Route path="/verbal-reasoning" element={<VerbalReasoning />} />
              <Route path="/current-affairs" element={<CurrentAffairs />} />
              <Route path="/programming" element={<Programming />} />
            </Routes>
          </div>
        </div>
      </div>
    </Router>
  );
};

export default App;
